import React from 'react'


const ImageLinkForm =() =>{
	return(
		<div className='ma4 mt0'>
			<Tilt className="Tilt br2 shadow-2" 
					options={{ max : 55 }} 
					style={{ height: 135, width: 135 }} >
 				<div className="Tilt-inner logo">
 					<img  alt = 'logo' 
 						  src={brain}/>
 				</div>
			</Tilt>
		</div>
	);
}
export default ImageLinkForm;
